window.bookSummaryJSON = "<p>\"My name is Mike Ross. I'm a Ferryman. I help people with ghost problems, or ghosts with people problems. Funny thing, no one ever helps me with my problems. Civil War ghosts bent on killing me, Skinwalkers who just want my body, and a vindictive spirit linked both to my bloodline and my destiny.... It turns out the dead still hold a good deal of influence over the world, and they don't want to give it up. I'm in way over my head. Fortunately, I'm too stubborn to quit.\"</p>"; 
